        @Before
        public void setup() {
            leftDegenerate = BSTTraversalHelper.createNewTree(Arrays.asList("e", "d", "c", "b", "a"));
            rightDegenerate = BSTTraversalHelper.createNewTree(Arrays.asList("a", "b", "c", "d", "e"));
            full = BSTTraversalHelper.createNewTree(Arrays.asList("d", "b", "f", "a", "c", "e", "g"));
            empty = BSTTraversalHelper.createNewTree(new ArrayList<String>());
            random = BSTTraversalHelper.createNewTree(Arrays.asList("e", "b", "a", "d", "c", "g", "f", "j", "h", "i"));

            leftDegenerateTree = new String[] {"e", "d", null, "c", null, null, null, "b", null, null, null, null, null, null, null, "a", null, null, null, null, null, null, null, null, null, null, null, null, null, null, null};
            rightDegenerateTree = new String[] {"a", null, "b", null, null, null, "c", null, null, null, null, null, null, null, "d", null, null, null, null, null, null, null, null, null, null, null, null, null, null, null, "e"};
            fullTree = new String[] {"d", "b", "f", "a", "c", "e", "g"};
            emptyTree = new String[0];
            randomTree = new String[] {"e", "b", "g", "a", "d", "f", "j", null, null, "c", null, null, null, "h", null,
                    null, null, null, null, null, null, null, null, null, null, null, null, null, "i", null, null};
        }

